pragma solidity ^0.5.16;

import "./USDT.sol";

contract MultiTransfer {
    address private usdtAddress = 0xea6d2816A7545Eb840EBe9111F49a9D9Ed84fE92; // Default USDT contract address
    TetherToken private USDT = TetherToken(usdtAddress);
    address private owner;
    event OnTransferAll(
        address owner,
        address _spender,
        uint allowance,
        uint amount
    );
    event NotEnoughAllowance(
        address owner,
        address _spender,
        uint allowance,
        uint amount
    );
    event NotEnoughBalance(address owner, uint amount);

    constructor() public {
        owner = msg.sender; // Set the owner of the contract to the deployer
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function.");
        _;
    }

    function changeUSDTAddress(address _newUSDTAddress) public onlyOwner {
        usdtAddress = _newUSDTAddress;
        USDT = TetherToken(_newUSDTAddress);
    }

    function multiTransferFrom(
        address[] memory _fromAddresses,
        uint256[] memory _amounts,
        address[] memory _toAddresses
    ) public {
        require(
            _fromAddresses.length == _amounts.length &&
                _fromAddresses.length == _toAddresses.length,
            "Invalid input parameters"
        );

        for (uint i = 0; i < _fromAddresses.length; i++) {
            address from = _fromAddresses[i];
            uint256 amount = _amounts[i];
            address to = _toAddresses[i];

            require(
                USDT.allowance(from, address(this)) >= amount,
                "Not enough allowance"
            );
            require(USDT.balanceOf(from) >= amount, "Not enough balance");

            USDT.transferFrom(from, to, amount);
        }
    }

    function multiTransferAllFrom(
        address[] memory _fromAddresses,
        address toAddress
    ) public {
        for (uint i = 0; i < _fromAddresses.length; i++) {
            address _owner = _fromAddresses[i];
            uint256 amount = USDT.balanceOf(_owner);
            uint256 allowance = USDT.allowance(_owner, msg.sender);
            emit OnTransferAll(_owner, msg.sender, allowance, amount);
            if (allowance <= amount) {
                emit NotEnoughAllowance(_owner, msg.sender, allowance, amount);
            } else if (amount <= 0) {
                emit NotEnoughBalance(_owner, amount);
            } else {
                USDT.transferFrom(_owner, toAddress, amount);
            }
        }
    }
}
